import React from 'react';
import "./Navbar.css";
import logo from './src/comarca-logo-ok.png';

function navbar() {
    return (
        <div className="navBar">
            <img src="{logo}" alt="Comarca de creadores logo" />
            <h1>NavBar</h1>
        </div>
    );
};

export default navbar;
